import L from 'leaflet';

const createCustomIcon = () => {
    return L.icon({
        iconUrl: 'icon.png',
        iconSize: [32, 32],
        iconAnchor: [16, 32],
        popupAnchor: [0, -32]
    });
};

export default createCustomIcon;
